func Test_reversePairs(t *testing.T) {
	ast := assert.New(t)

	for _, tc := range tcs {
		fmt.Printf("~~%v~~\n", tc)
		ast.Equal(tc.ans, reversePairs(tc.nums))
	}
}

func Benchmark_reversePairs(b *testing.B) {
	for i := 0; i < b.N; i++ {
		for _, tc := range tcs {
			reversePairs(tc.nums)
		}
	}
}
